text:
don’t think i forgot to tell you about the best part of my order...the freebies! i mean free frank y’all at $75 a bottle it doesn’t get any better than that! except it did because i got 4 more oils as well! ⠀⠀⠀⠀⠀⠀⠀⠀⠀
//⠀⠀⠀⠀⠀⠀⠀⠀⠀
lemongrass- so good on dryer balls because the scent lasts the longest on your clothes or diapers in my case! it is the vitality line hence the white label so add it to your fave soup! ⠀⠀⠀⠀⠀⠀⠀⠀⠀
//⠀⠀⠀⠀⠀⠀⠀⠀⠀
gathering- young living does a great job at tailoring their promo oils to what’s going on around that time! so of course gathering will be the perfect addition to the holidays when we are surrounded by our loved ones! ⠀⠀⠀⠀⠀⠀⠀⠀⠀
//⠀⠀⠀⠀⠀⠀⠀⠀⠀
frankincense- we all know that this was given to fetus jesus but did you know that at the time it was worth more than gold? being grounding for emotional support and amazing for your skin and immune system i know exactly why this was the perfect gift for him! ⠀⠀⠀⠀⠀⠀⠀⠀⠀
//⠀⠀⠀⠀⠀⠀⠀⠀⠀
joy- joy to the world that we have some joy! this oil has quickly become one of my go to’s! as moms we can often be overwhelmed especially this time of year so rub some joy over your heart and let the christmas cheer begin! ⠀⠀⠀⠀⠀⠀⠀⠀⠀
// ⠀⠀⠀⠀⠀⠀⠀⠀⠀
white angelica- y’all have heard me rave about this oil but it’s because it’s that amazing! it is my number one for emotional support and hudson’s too! i often find myself huffing it 🤣⠀⠀⠀⠀⠀⠀⠀⠀⠀
//⠀⠀⠀⠀⠀⠀⠀⠀⠀
